package de.kay_muench.imageinformationprovider;

import static org.junit.Assert.assertEquals;

import java.io.IOException;
import java.net.MalformedURLException;
import java.net.URI;
import java.net.URISyntaxException;

import org.junit.Before;
import org.junit.Test;

public class ImageInformationProviderTest {

	final ImageInformationProvider provider = new ImageInformationProvider();

	@Before
	public void setUp() throws Exception {
	}

	@Test(expected = RuntimeException.class)
	public void assert_Exception_with_unavailable_Image() {
		final String uri = "target/test-classes/never-have-this.jpg";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
	}

	@Test
	public void assert_FlowersJpg_IsAJpg_301px_Width_290px_Height() {
		final String uri = "target/test-classes/flowers.jpg";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/jpeg", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersPng_IsAPng_301px_Width_290px_Height() {
		final String uri = "target/test-classes/flowers.png";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/png", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersTif_IsATiff_301px_Width_290px_Height() {
		final String uri = "target/test-classes/flowers.tif";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/tiff", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersFakePng_IsATiff_301px_Width_290px_Height() {
		final String uri = "target/test-classes/flowers-really-tif.png";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/tiff", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersFakeJpg_IsAPng_301px_Width_290px_Height() {
		final String uri = "target/test-classes/flowers-really-png.jpg";
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals(uri, information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/png", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersPng_IsAPng_301px_Width_290px_Height_using_Uri_1()
			throws URISyntaxException {
		final URI uri = new URI("file://target/test-classes/flowers.png");
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals("target/test-classes/flowers.png", information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/png", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersPng_IsAPng_301px_Width_290px_Height_using_Uri_2()
			throws URISyntaxException {
		final URI uri = new URI("file://./target/test-classes/flowers.png");
		ImageInformation information = this.provider.provideFor(uri);
		assertEquals("./target/test-classes/flowers.png", information.getUri());
		assertEquals("", information.getAlt());
		assertEquals("image/png", information.getMimeType());
		assertEquals(301, information.getWidth());
		assertEquals(290, information.getHeight());
	}

	@Test
	public void assert_FlowersJpg_hasCorrectDataUri() throws URISyntaxException,
			MalformedURLException, IOException {
		final URI uri = new URI("file://./target/test-classes/flowers.jpg");
		ImageInformation information = this.provider.provideFor(uri);
		ImageDataUriProvider dataUriProvider = new ImageDataUriProvider();
		assertEquals(
				"data:image/jpeg;base64,",
				dataUriProvider.provideFor(information).replaceAll("\\s", ""));
	}

	@Test
	public void assert_FlowersPng_hasCorrectDataUri() throws URISyntaxException,
			MalformedURLException, IOException {
		final URI uri = new URI("file://./target/test-classes/flowers.png");
		ImageInformation information = this.provider.provideFor(uri);
		ImageDataUriProvider dataUriProvider = new ImageDataUriProvider();
		StringBuilder sb = new StringBuilder(200000);
		sb.append("data:image/png;base64,");
		sb.append("");
		sb.append("");
		sb.append("");
		assertEquals(sb.toString(), dataUriProvider.provideFor(information)
				.replaceAll("\\s", ""));
		//
	}

}
